raw_question: What are the first, middle, and last names, along with the ids, of all students who enrolled in 2 degree programs in one semester? 
question_index: 534 
constants:
 - 2
join_columns:
 - student_id
groupby_columns:
 - student_id
functions:
 - count
comment: |-
  SELECT T1.first_name,
         T1.middle_name,
         T1.last_name,
         T1.student_id
  FROM Students AS T1
  JOIN Student_Enrolment AS T2 ON T1.student_id = T2.student_id
  GROUP BY T1.student_id
  HAVING count(*) = 2

sql: |-
  SELECT T1.first_name,
